B.acH=new A.ae(B.adK,["Esim","Language","English","Spanish","Portuguese","My Esims","Home","About Us","Contact Us","Esim Store","Profile","Buy Esims","Data Plans","Available Data Plans","Country","Regional","Popular Country Plans","Popular Regional Plans","See all","Regions","Sky is your trusted partner for seamless global connectivity. We provide reliable eSIM solutions for travelers worldwide, ensuring you stay connected wherever your adventures take you.","Sky Links","(+876) 8329390","silas@byllkreate.com","1000 Old Hope Road, Kingston 10","Download Our App","Sky Instagram","\xa9 2025  Designed by Byllkreate Tech Ltd","Active","Archived","No Active Esims Found!","No Archived Esims Found!","Bundle","Status","Data","Notes","Remaining Days","Plan Status","Lifetime Prepaid","Used","Travel","TOP UP","Activate","Name","Speed","Validity","Price","Days","Unlimited","GB","USD","BUY NOW","N/A","Plan Summary","Checkout","This eSim is for travelers to ","and will not work outside these regions","Additional Information","Description","Networks","etc.","Activation Policy","The validity time starts when the eSim connects to any supported network/s.","Ip Location","Coverage","Secure Checkout","Complete Purchase","Please confirm your device is eSim compatible and network-unlocked.","Learn More","Payment Details","Edit Profile","Recent Transactions","Need Help?","Help Desk","Privacy Policy","Sign Out","Completed","In Progress","Failed","Canceled","Error","Help Desk","We are here to help you with all of your Esim concerns Send us a message below and we will see if we can assist you to the best of our abilities","Sky is your ultimate solution for hassle-free mobile connectivity across the Caribbean. We understand that navigating a new destination can be overwhelming, especially when it comes to communication. Submit a message below and we will see if we can assist you to the best of our abilities","Message","Submit","FAQ","What is an eSIM?","An eSIM (embedded SIM) is a digital SIM card embedded in your device that allows you to activate a mobile network without the need for a physical SIM card. It functions similarly to a traditional SIM but is more flexible and convenient.","How does Sky eSIMs work?","Sky eSIMs work by digitally connecting your device to our partner networks across the Caribbean. Simply purchase a plan, scan the QR code, and follow the activation instructions to get connected instantly.","Is my device compatible with eSIM?","Most modern smartphones and tablets support eSIM technology. This includes recent iPhone models (XS and newer), Google Pixel devices (Pixel 2 and newer), and many Samsung Galaxy devices. You can check your device's settings or manufacturer specifications to confirm eSIM compatibility.","Message sent successfully!","Please enter a message","Settings","Auto Generated based on username","Account Information","User Name","First Name","Last Name","Change Password","New Password","Retype Password","Billing Information","Edit","Card Name","Account Settings","Send Push Notifications","Send Email Notifications","Generate Profile Image","Constants","Price Percentage","SAVE & CONTINUE","Profile Updated","Welcome Back!","Sign Up","Continue with Google","Terms and Conditions","By continuing, you agree to the","and","Log In","Password","LOGIN","Forget Your Password?","Do not have an account?","Create Account","Already have an account?","Confirm Password","Verify Email","A verification Link was sent code in your email. You Must have a valid email to change your password","CONTINUE","Resend","Skip>>","Email","Password","First Name","Last Name","Confirm Password","Skip>>","Text, Talk, Browse Anywhere","Provide us with the necessary required information and let us do all the data you need!!!","Activate Your eSIM, Connect and Enjoy!","Once activated, your device will automatically connect to our network. You can manage your eSIM settings anytime through the app.","CONTINUE","eSIM Plans","Support","Help Desk","Profile","Settings","Sky eSIM","Global eSIM connectivity provider offering instant activation, competitive pricing, and 24/7 support worldwide","customer service","support@matsilmobile.com","English","Sky","eSIM Data Plan","Data Amount","Validity Period","Coverage","Bundle Type","In Stock","Sky","{dataAmount} high-speed data eSIM for {bundleName}. {validity}. Coverage in {coverage}. Instant activation, no physical SIM required.","eSIM Data Plans - Global Coverage | Sky","Browse our collection of eSIM data plans with global coverage. Instant activation, competitive pricing, and 24/7 support. Find the perfect plan for your travel needs.","{bundleName} eSIM Data Plans - Sky","Browse {bundleName} eSIM data plans starting from {dataAmount}. Coverage in {coverage}. Instant activation, competitive pricing.","Can I use the eSIM internationally?","Yes, depending on your plan's coverage. Our eSIM plans provide coverage in multiple countries and regions worldwide. Check the specific plan details for coverage information.","How do I activate my eSIM?","After purchase, you'll receive an email with a QR code and activation instructions. Scan the QR code with your device or manually enter the activation details in your device settings.","Can I use multiple eSIMs on one device?","Yes, most devices support multiple eSIM profiles, though you can typically only use one at a time unless your device supports Dual SIM Dual Standby.","What happens when my data runs out?","You can purchase additional data through our app or website. Some plans also offer automatic top-up options to ensure you stay connected.","How do I check my data usage?","You can check your data usage through our mobile app or by logging into your account on our website. Real-time usage information is available.","How long does activation take?","eSIM activation is instant! Once you complete the purchase, you'll receive the activation details immediately via email.","What if my eSIM doesn't work?","If you experience any issues, our 24/7 support team is available to help. Contact us through the help desk or support chat.","Can I transfer my eSIM to another device?","eSIMs are typically tied to the device they're activated on. You'll need to purchase a new eSIM for a different device.","Do I need to remove my physical SIM?","No, you can use both your physical SIM and eSIM simultaneously on devices that support Dual SIM Dual Standby."],t.l)
